function update(){
    // adjust textarea height
    $(".txtLogographicInput").height($(".logographicWords").height());

    // show hint
    $(".gameStatusLabel:only-child").after("<div id='hint' />");
    var hint = "Hint: ";
    var first = $(".logographicWords span[style*='red']").text()[0];
    if(first) hint = "Hint: "+first+"="+dict[first];
    $("#hint").text(hint);
    setTimeout(update, 1000);
}
setTimeout(update, 1000);

